import { React, useState } from "react";
import { ScrollView, Text, TextInput, View, Button } from "react-native";
import { Formik } from "formik";
import * as Yup from "yup";

export default function ListTodo({ item }) {

  return (
    <ScrollView>
      <View >
        <Text>{item.value}</Text>
        <Button title="Delete" />
        <Button title="Update" />
      </View>
    </ScrollView>
  );
}
